(707, 10, 'text_image_1_text', 'Conquistando novos mercados e se fortalecendo nos que já atua, a UniSuper vem crescendo com sustentabilidade e planejamento estratégico, fazendo com que a Rede seja reconhecida e respeitada por toda cadeia que a envolve, como fornecedores, comunidade e colaboradores. Consolidando-se como uma marca inovadora e estreitando cada vez mais a relação de proximidade com o cliente do mercado gaúcho, as lojas da Rede oferecem preço justo e atendimento diferenciado para um público fiel e exigente. Frutas e verduras entregues diariamente pelo distribuidor, padaria completa com pães, doces e salgados variados, além do açougue com carnes de procedência e cortes especiais, com qualidade superior, como o novilho Angus, tornaram-se marca registrada da Rede UniSuper.'),
(708, 10, '_text_image_1_text', 'field_6281728a3a5c9'),
(709, 10, 'text_image', '2'),
(710, 10, '_text_image', 'field_628172213a5c7'),
(711, 10, 'messege_text', 'Estamos crescendo com sustentabilidade e somos reconhecidos pelo \r\ncuidado, atenção, qualidade em produtos e serviços, sempre baseados \r\nnuma relação de proximidade com nossos clientes.'),
