(753, 138, 'text_image_0_text', '<h2>Sobre a Rede UniSuper</h2>\r\nFormada pela união de um grupo de empresas gaúchas desde 2000, a Rede UniSuper está entre as tradicionais marcas de supermercados do Rio Grande do Sul. Buscando crescimento no setor varejista, a UniSuper reformulou seu plano de negócios, reestruturando as lojas licenciadas e abrindo lojas próprias neste novo formato. Hoje, em constante expansão, a Rede tem 42 lojas e está presente em 18 cidades: Alvorada, Balneário Pinhal, Cachoeirinha, Canoas, Capão da Canoa, Capela de Santana, Dois Irmãos, Esteio, Gravataí, Ivoti, Novo Hamburgo, Osório, Pelotas, Porto Alegre, São Leopoldo, Sapucaia do Sul, Viamão e Xangri-lá.'),
