(818, 22, 'title', 'Quero ser\r\num Licenciado'),
(819, 22, '_title', 'field_628189a8742ed'),
(820, 22, 'description', 'A UniSuper não para de crescer, e quer contar com você para fazer parte deste sucesso. Trabalhamos incansavelmente para trazer soluções que atendam as demandas do mercado, pois temos como objetivo, buscar a excelência no que fazemos.\r\n\r\nHoje, a Unisuper traz muitas vantagens para seus parceiros, pois temos ferramentas e profissionais dedicados que fazem a diferença no resultado final.\r\n\r\nVisando um crescimento estratégico e consistente, a Rede disponibiliza aos novos Licenciados, um projeto de viabilidade urbana seguido por uma consultoria financeira e operacional, que vai de acordo com as exigências de cada lojista, isso assegura e fortalece a Rede, na sua parceria com os Licenciados.'),
(821, 22, '_description', 'field_62818acd742ee'),
(822, 22, 'text', 'Com um layout moderno e padronização diferenciada, contamos com lojas aconchegantes para nossos clientes fazerem suas compras com praticidade e qualidade. Todas as lojas da Rede foram elaboradas com um padrão de sinalização para gerar uma experiência de compra agradável aos clientes.'),
(823, 22, '_text', 'field_62818add742ef'),
(824, 22, 'layout_0_icon', '151'),
(825, 22, '_layout_0_icon', 'field_62818b11742f1'),
(826, 22, 'layout_0_title', 'Geomarketing'),
(827, 22, '_layout_0_title', 'field_62818b34742f2'),
(828, 22, 'layout_0_text', 'Constitui-se de um plano de negócios complexo que trabalha não só a viabilidade urbana, mas também a gestão empresarial em um âmbito de excelência.\r\n<ul>\r\n 	<li>Reorganização funcional</li>\r\n 	<li>Finanças</li>\r\n 	<li>Tributação</li>\r\n 	<li>Estratégias de vendas</li>\r\n 	<li>Redução de custos</li>\r\n</ul>'),
(829, 22, '_layout_0_text', 'field_62818b51742f3'),
(830, 22, 'layout_1_icon', '150'),
(831, 22, '_layout_1_icon', 'field_62818b11742f1'),
(832, 22, 'layout_1_title', 'Logística Integrada'),
(833, 22, '_layout_1_title', 'field_62818b34742f2'),
(834, 22, 'layout_1_text', 'A logística é um diferencial oferecido pela Rede, pois as lojas podem trabalhar com estoque baixo, tendo como seu pulmão nosso CD, isso diminui custos e o tempo destinado\r\na negociações e conferencias. Nossa frota é própria e os caminhões são equipados com plataforma, assim facilitando a descarga dos produtos\r\nno PDV.'),
(835, 22, '_layout_1_text', 'field_62818b51742f3'),
(836, 22, 'layout', '2'),
