(866, 153, '_form', '<div class=\"c-form\">\n<div class=\"c-form__control\">\n[text* nome class:o-input placeholder \"Nome*\"]\n</div>\n<div class=\"c-form__control c-form__control-col\">\n[email* email class:o-input class:o-input--239 placeholder \"E-mail*\"]\n[text* telefone class:o-input class:o-input--188 class:js-telphone placeholder \"Telefone*\"]\n</div>\n<div class=\"c-form__control\">\n[text* cep class:o-input class:o-input--cep class:cf7-cep-autofill class:js-cep placeholder \"CEP*\"]\n</div>\n<div class=\"c-form__control c-form__control-col\">\n[text* uf class:o-input class:o-input--123 class:cf7-cep-autofill__uf placeholder \"UF*\"]\n[text* cidade class:o-input class:o-input--300 class:cf7-cep-autofill__cidade placeholder \"Cidade*\"]\n</div>\n<div class=\"c-form__control c-form__control-col\">\n[text* bairro class:o-input class:o-input--239 class:cf7-cep-autofill__bairro placeholder \"Bairro*\"]\n[text* complemento class:o-input class:o-input--188 placeholder \"Complemento*\"]\n</div>\n<div class=\"c-form__control c-form__control-col\">\n[text* endereco_comercial class:o-input class:o-input--300 class:cf7-cep-autofill__rua placeholder \"Endereço do ponto comercial*\"]\n[text* numero class:o-input class:o-input--123 class:o-input--select placeholder \"Nº*\"]\n</div>\n<div class=\"c-form__control\">\n[text* metregem class:o-input placeholder \"Metragem da Loja (Área de Vendas)*\"]\n</div>\n<div class=\"c-form__control c-form__control-col\">\n[text* check_outs class:o-input class:o-input--188 placeholder \"Nº de check outs*\"]\n[text* faturamento class:o-input class:o-input--239 placeholder \"Faturamento*\"]\n</div>\n<div class=\"c-form__control\">\n[text* estacionamento class:o-input placeholder \"Nº de vagas de estacionamentos*\"]\n</div>\n<div class=\"c-form__control\">\n[textarea textarea class:o-input class:o-input--textarea placeholder \"Observações\"]\n</div>\n<div class=\"c-form__control o-input--btn\">\n[submit class:o-btn class:o-btn--submit \"Enviar\"]\n</div>\n</div>'),
