(1222, 219, 'description', 'Como já anunciado nos principais veículos de comunicação \r\ndo RS, o UniSuper está reestruturando o negócio através de \r\num complexo processo de integração das operações de \r\ncinco redes supermercadistas, licenciadas da marca e que, \r\nem conjunto, detêm o controle acionário d...'),
