(1228, 218, 'description', 'A Rede UniSuper reinaugurou nesta quinta-feira, 29/04, sua \r\nloja situada na Av. Antônio Gomes Correa, 950 no Parque \r\ndos Anjos em Gravataí. A unidade passou por uma reforma \r\ndeixando-a no novo padrão UniSuper, tanto na sua fachada \r\ncomo na comunicação visual interna...'),
(1229, 218, '_description', 'field_62850a5224ecc'),
(1230, 218, 'text', '<img class=\"alignnone size-full wp-image-232\" src=\"http://localhost/unisuper/wp-content/uploads/2022/05/loja-gravatai.jpg\" alt=\"\" width=\"681\" height=\"410\" />\r\n<h2>Rede UniSuper reinaugura a loja do Parque dos Anjos em Gravataí</h2>\r\n<h3><em><strong><span style=\"color: #009a4d;\">A Rede UniSuper reinaugurou nesta quinta-feira, 29/04, sua loja situada na Av. Antônio Gomes Correa, 950 no Parque dos Anjos em Gravataí.</span></strong></em></h3>\r\nA unidade passou por uma reforma deixando-a no novo padrão UniSuper, tanto na sua fachada como na comunicação visual interna.\r\n\r\nA mesma qualidade que o cliente já estava acostumado, mas numa loja mais moderna, pois o que nunca muda é o nosso compromisso de oferecer produtos de qualidade, preços justos e um atendimento diferenciado, marcas registradas da UniSuper e motivo de orgulho que faz dessa, uma das redes mais queridas pelos gaúchos.\r\n\r\nA Rede UniSuper tem 45 lojas distribuídas em 18 cidades do Rio Grande do Sul, maior parte na região metropolitana de Porto Alegre.'),
(1231, 218, '_text', 'field_62850ab524ece'),
(1232, 217, 'image', '228'),
(1233, 217, '_image', 'field_62850a4224ecb'),
