(1417, 251, '_form', '<div class=\"o-grid o-grid__col-2 o-grid__gap-60\">\n<div class=\"fade-in fade-in-right\">\n<h2 class=\"o-ttl o-ttl--45 o-ttl--bold o-ttl--white\">Novidades UniSuper</h2>\n<p class=\"o-ttl o-ttl--38 o-ttl--white\">Cadastre-se e receba <br> novidades e ofertas!</p>\n</div>\n<div class=\"c-form fade-in fade-in-up\">\n<div class=\"c-form__control\">\n[text nome class:o-input placeholder \"Nome\"]\n</div>\n<div class=\"c-form__control\">\n[email email class:o-input placeholder \"E-mail\"]\n</div>\n<div class=\"c-form__control o-input--btn\">\n[submit class:o-btn class:o-btn--submit \"Enviar\"]\n</div>\n<div class=\"c-form__control\">\n[acceptance acceptance class:o-input class:o-input--accept] Ao assinalar, aceito os <a class=\"o-link--accept\" href=\"\">termos de uso</a> e as <a class=\"o-link--accept\" href=\"\">políticas de privacidade</a> da UniSuper. [/acceptance]\n</div>\n</div>\n</div>'),
